import * as React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import ProfileScreen from './screens/Profile';
import SettingsScreen from './screens/Settings';
import { MaterialCommunityIcons } from '@expo/vector-icons';
import { Feather } from '@expo/vector-icons';
import { FontAwesome5 } from '@expo/vector-icons';
import SavedScreen from './screens/Saved';
import ReferScreen from './screens/Refer';
import DrawerItems from './constants/DrawerItems';
import css from './assets/css';
import {Button, Image,StyleSheet, Text, View } from 'react-native';
import 'bootstrap/dist/css/bootstrap.min.css';
import Breadcrumb from "react-bootstrap/Breadcrumb";
import Card from 'react-bootstrap/Card'
import { ActivityIndicator, Colors } from 'react-native-paper';

const Drawer = createDrawerNavigator();

function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Button
        onPress={() => navigation.navigate('Notifications')}
        title="Go to notifications"
      />  <MaterialCommunityIcons 
      name="face-profile"
      size={24} 
      color="#e91e63" 
  />
   <Feather 
                name="settings"
                size={24} 
                color="#e91e63" 
              /> 
               <FontAwesome5 
                name="user-friends"
                size={24} 
                color= "#e91e63" 
              />
<MaterialCommunityIcons 
      name="bookmark-check-outline"
      size={24} 
      color="#e91e63" 
  />
      <Text style={css.test}>test2</Text>
      <Breadcrumb>
        <Breadcrumb.Item href="#">Home</Breadcrumb.Item>
        <Breadcrumb.Item href="#">Profile</Breadcrumb.Item>
        <Breadcrumb.Item active>Test123</Breadcrumb.Item>
      </Breadcrumb>
      <Card className="text-center">
  <Card.Header>Featured</Card.Header>
  <Card.Body>
    <Card.Title>Special title treatment</Card.Title>
    <Card.Text>
      With supporting text below as a natural lead-in to additional content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
  <Card.Footer className="text-muted">2 days ago</Card.Footer>
</Card>
<ActivityIndicator animating={true} color={Colors.red800} />
    </View>
  );
}

function NotificationsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Button onPress={() => navigation.goBack()} title="Go back home" />
    </View>
  );
}


export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeScreen} />
        <Drawer.Screen
         options={{
          drawerIcon: ({focused, size}) => (
            <Feather 
            name="settings"
            size={20} 
            color="#e91e63" 
          /> 
          ),
       }}

        name="Notifications" component={ProfileScreen} />
        <Drawer.Screen name="About us" component={NotificationsScreen} />
        <Drawer.Screen name="Settings" component={NotificationsScreen} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
